import React from "react";

const AddProduct =() =>{
    return(
        <div className="product">
            <h1>Add Product</h1>
            <input type="tex" placeholder="Enter product name" className="inputBox" />
            <input type="tex" placeholder="Enter product price" />
            <input type="tex" placeholder="Enter product category" />
            <input type="tex" placeholder="Enter product company" />
            <button>Add Product</button>
        </div>
    )
}

export default AddProduct;
